import React, { useState } from "react";
import { motion } from "framer-motion";
import IProps from "./interface";
// https://svg2jsx.com/

const transitionBorder = { duration: 0.8, ease: "easeInOut" };

const transitionGreen1 = { duration: 0.7, ease: "easeInOut", delay: 0.4 };

const transitionGreen2 = { duration: 0.6, ease: "easeInOut", delay: 0.7 };

const transitionSun = { duration: 1, ease: "easeInOut", delay: 0.9 };

const pathBorder = {
    initial: {
        rotate: 180
    },
    animate: {
        rotate: 360
    }
};

const pathGreen1 = {
    initial: {
        scale: 0
    },
    animate: {
        scale: 1
    }
};

const pathSun = {
    initial: {
        scale: 0,
        y: 500
    },
    animate: {
        scale: 1,
        y: 383
    }
};

function IconMotion(props: IProps) {
    const [refresh, setRefresh] = useState(false);
    return (
        <motion.svg
            style={{ height: props.height || "300", width: props.width || "300" }}
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
            fillRule="evenodd"
            strokeLinejoin="round"
            strokeMiterlimit="2"
            clipRule="evenodd"
            viewBox="0 0 1707 1440"
            onClick={() => setRefresh(!refresh)}
        >
            <motion.use
                width="640"
                height="670"
                x="450"
                y="230"
                xlinkHref="#_Image1"
                initial={"initial"}
                animate={"animate"}
                variants={pathBorder}
                transition={transitionBorder}
            />
            <motion.use
                width="264"
                height="160"
                x="497"
                xlinkHref="#_Image2"
                initial={"initial"}
                animate={"animate"}
                variants={pathSun}
                transition={transitionSun}
            />
            <motion.use
                width="505"
                height="281"
                x="500"
                y="511"
                xlinkHref="#_Image3"
                initial={"initial"}
                animate={"animate"}
                variants={pathGreen1}
                transition={transitionGreen1}
            ></motion.use>
            <motion.use
                width="280"
                height="164"
                x="774"
                y="515"
                xlinkHref="#_Image4"
                initial={"initial"}
                animate={"animate"}
                variants={pathGreen1}
                transition={transitionGreen2}
            ></motion.use>
            <motion.defs>
                <motion.image
                    id="_Image1"
                    width="640"
                    height="670"
                    xlinkHref="data:image/png;base64,"
                ></motion.image>
                <motion.image
                    id="_Image2"
                    width="264"
                    height="160"
                    xlinkHref="data:image/png;base64,"
                ></motion.image>
                <motion.image
                    id="_Image3"
                    width="505"
                    height="281"
                    xlinkHref="data:image/png;base64,"
                ></motion.image>
                <motion.image
                    id="_Image4"
                    width="280"
                    height="164"
                    xlinkHref="data:image/png;base64,"
                ></motion.image>
            </motion.defs>
        </motion.svg>
    );
}

export default IconMotion;
